import React from 'react'
import { View, Text, FlatList, StyleSheet } from 'react-native'

export default function HomeScreen(){
    const menuItems = [
        {name: 'Item 1', backgroundColor: 'red'},
        {name: 'Item 2', backgroundColor: 'blue'},
        {name: 'Item 3', backgroundColor: 'green'},
        {name: 'Item 4', backgroundColor: 'yellow'},
    ]

    return(
        <FlatList
            data = {menuItems}
            numColumns = {3}
            renderItem = {({item}) => (
                <View style={styles.container}>
                    <View style={{...styles.circle, backgroundColor: item.backgroundColor}}></View>
                    <Text>{item.name}</Text>
                </View>
            )
            }
        >
        </FlatList>
    )
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
        paddingTop: 10
    },
    circle: {
        height: 60,
        width: 60,
        borderRadius: 60 / 2,
        backgroundColor: 'red'
    }
})
